ward for Best single in 1988. Stock Aitken and Waterman wrote and produced the track which was the lead-off single and lead track from Ricks debut LP Whenever You Need Somebody.  The album was itself a UK number one and would go on to sell over 15 million copies worldwide.\n\nThe legendary video was directed by Simon West  who later went on to make Hollywood blockbusters such as Con Air, Lara Croft  Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube views milestone on 28 July 2021.\n\nSubscribe to the official Rick Astley YouTube channel: https://RickAstley.lnk.to/YTSubID\n\nFollow Rick Astley:\nFacebook: https://RickAstley.lnk.to/FBFollowID \nTwitter: https://RickAstley.lnk.to/TwitterID \nInstagram: https://RickAstley.lnk.to/InstagramID \nWebsite: https://RickAstley.lnk.to/storeID \nTikTok: https://RickAstley.lnk.to/TikTokID\n\nListen to Rick Astley:\nSpotify: https://RickAstley.lnk.to/SpotifyID \nApple Music: https://RickAstley.lnk.to/AppleMusicID \nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWere no strangers to love\nYou know the rules and so do I\nA full commitments what Im thinking of\nYou wouldnt get this from any other guy\n\nI just wanna tell you how Im feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWeve known each other for so long\nYour hearts been aching but youre too shy to say it\nInside we both know whats been going on\nWe know the game and were gonna play it\n\nAnd if you ask me how Im feeling\nDont tell me youre too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo","isCrawlabl est single in 1988. Stock Aitken and Waterman wrote and produced the track which was the lead-off single and lead track from Ricks debut LP Whenever You Need Somebody.  The album was itself a UK number one and would go on to sell over 15 million copies worldwide.\n\nThe legendary video was directed by Simon West  who later went on to make Hollywood blockbusters such as Con Air, Lara Croft  Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube views milestone on 28 July 2021.\n\nSubscribe to the official Rick Astley YouTube channel: https://RickAstley.lnk.to/YTSubID\n\nFollow Rick Astley:\nFacebook: https://RickAstley.lnk.to/FBFollowID \nTwitter: https://RickAstley.lnk.to/TwitterID \nInstagram: https://RickAstley.lnk.to/InstagramID \nWebsite: https://RickAstley.lnk.to/storeID \nTikTok: https://RickAstley.lnk.to/TikTokID\n\nListen to Rick Astley:\nSpotify: https://RickAstley.lnk.to/SpotifyID \nApple Music: https://RickAstley.lnk.to/AppleMusicID \nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWere no strangers to love\nYou know the rules and so do I\nA full commitments what Im thinking of\nYou wouldnt get this from any other guy\n\nI just wanna tell you how Im feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWeve known each other for so long\nYour hearts been aching but youre too shy to say it\nInside we both know whats been going on\nWe know the game and were gonna play it\n\nAnd if you ask me how Im feeling\nDont tell me youre too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo"},"lengthSeconds":"214 who later went on to make Hollywood blockbusters such as Con Air, Lara Croft  Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube views milestone on 28 July 2021.\n\nSubscribe to the official Rick Astley YouTube channel: https://RickAstley.lnk.to/YTSubID\n\nFollow Rick Astley:\nFacebook: https://RickAstley.lnk.to/FBFollowID \nTwitter: https://RickAstley.lnk.to/TwitterID \nInstagram: https://RickAstley.lnk.to/InstagramID \nWebsite: https://RickAstley.lnk.to/storeID \nTikTok: https://RickAstley.lnk.to/TikTokID\n\nListen to Rick Astley:\nSpotify: https://RickAstley.lnk.to/SpotifyID \nApple Music: https://RickAstley.lnk.to/AppleMusicID \nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWere no strangers to love\nYou know the rules and so do I\nA full commitments what Im thinking of\nYou wouldnt get this from any other guy\n\nI just wanna tell you how Im feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWeve known each other for so long\nYour hearts been aching but youre too shy to say it\nInside we both know whats been going on\nWe know the game and were gonna play it\n\nAnd if you ask me how Im feeling\nDont tell me youre too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo","commandRuns":[{"startIndex":180,"length":16,"onTap":{"innertubeCommand":{"clickTrackingParams":"CMwDENzXBBggIhMI5Yb6pe3OkgMVR4xmAh2ClAaUygEEjs3oog==","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/rickastleynever","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId s directed by Simon West  who later went on to make Hollywood blockbusters such as Con Air, Lara Croft  Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube views milestone on 28 July 2021.\n\nSubscribe to the official Rick Astley YouTube channel: https://RickAstley.lnk.to/YTSubID\n\nFollow Rick Astley:\nFacebook: https://RickAstley.lnk.to/FBFollowID \nTwitter: https://RickAstley.lnk.to/TwitterID \nInstagram: https://RickAstley.lnk.to/InstagramID \nWebsite: https://RickAstley.lnk.to/storeID \nTikTok: https://RickAstley.lnk.to/TikTokID\n\nListen to Rick Astley:\nSpotify: https://RickAstley.lnk.to/SpotifyID \nApple Music: https://RickAstley.lnk.to/AppleMusicID \nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWere no strangers to love\nYou know the rules and so do I\nA full commitments what Im thinking of\nYou wouldnt get this from any other guy\n\nI just wanna tell you how Im feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWeve known each other for so long\nYour hearts been aching but youre too shy to say it\nInside we both know whats been going on\nWe know the game and were gonna play it\n\nAnd if you ask me how Im feeling\nDont tell me youre too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo","commandRuns":[{"startIndex":180,"length":16,"onTap":{"innertubeCommand":{"clickTrackingParams":"CK0BENzXBBhWIhMI5Yb6pe3OkgMVR4xmAh2ClAaUygEEjs3oog==","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/rickastleynever","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}}," ID \n\nLyrics:\nWere no strangers to love\nYou know the rules and so do I\nA full commitments what Im thinking of\nYou wouldnt get this from any other guy\n\nI just wanna tell you how Im feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWeve known each other for so long\nYour hearts been aching but youre too shy to say it\nInside we both know whats been going on\nWe know the game and were gonna play it\n\nAnd if you ask me how Im feeling\nDont tell me youre too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo","commandRuns":[{"startIndex":180,"length":16,"onTap":{"innertubeCommand":{"clickTrackingParams":"CKgBENzXBBgmIhMI5Yb6pe3OkgMVR4xmAh2ClAaUygEEjs3oog==","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/rickastleynever","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUTCg9yaWNrYXN0bGV5bmV2ZXIYAQ%3D%3D"}}},"loggingDirectives":{"trackingParams":"CKgBENzXBBgmIhMI5Yb6pe3OkgMVR4xmAh2ClAaU"}},{"startIndex":197,"length":33,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBgQ040EGAciEwjlhvql7c6SAxVHjGYCHYKUBpRIxLuBrb2YjoZ1ygEEjs3oog==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa1E3UWJId1pYMEI3aHdGMHdLaG0wbHU2S0p1QXxBQ3Jtc0trR0dBWC1jZTNlZUhkV2FkXzJYZjlxS2o4b2NFajF1d1Z5YUw2b0M3U3ZpaWxGODZkdWhNVE5KM3Z4ak5TN3VkenpBYnFvOGpGYnJMMGx2VFZOTUZZWUkzZlROM3UxX2RFNGQxSTVCZjkwTTJwanR2RQ\u0026q=https%3A%2F%2Flinktr.ee%2Frickastleynever\u0026v=dQw4w9WgXcQ","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEn
